import { get } from '../../services/http';

import fetch from 'isomorphic-unfetch';

function Vouchers(props) {

    console.log( props.vouchers )

    return (
        <h1>teste</h1>
    );

}

Vouchers.getInitialProps = async function() {

    const data = await fetch(`http://10.0.1.60:3001/api/v1/voucher`);

    const vouchers =  await data.text()

    return {
        vouchers
    };
};

export default Vouchers;
